import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
    return <Card />;
}

function Card() {
    return (
        <div className="card">
            <Avatar />
            <Content />
            <Lang />
        </div>
    );
}

function Avatar() {
    <img src="./assets/images/dd.jpg" alt="" />;
}

function Content() {}

function Lang() {}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
